import React from 'react'
import styled from 'styled-components'

const Navbar = () => {
    return (
        <Nav>
            <Logo href="">
            IPL<span>Stats</span>
            </Logo>
            <Hamburger>
                <span />
                <span />
                <span />
            </Hamburger>
            <Menu>
                <Menulink href="">Item1</Menulink>
                <Menulink href="">Item2</Menulink>
                <Menulink href="">Item3</Menulink>
                <Menulink href="">Item4</Menulink>
            </Menu>
        </Nav>
    )
}

const Nav = styled.div`
    padding: 0 2rem;
    display: flex;
    justify-content:space-between;
    align-items:center;
`;
const Logo = styled.a``;
const Hamburger = styled.div``;
const Menu = styled.div``;
const Menulink = styled.a``;

export default Navbar
